import React from "react";
import "./about.css";

const About = () => {
  return (
    <div>
      <h1>This is my about page.</h1>
      <p>
        We celebrate women and men in their real, most raw, authentic
        brilliance, who believe in themselves and are ready to step into the
        look they love. We employ hair products with some of the most natural
        and rich ingredients because we believe you should never expect less.
      </p>
    </div>
  );
};

export default About;
